import React from 'react';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Typography from '@material-ui/core/Typography';
import '../styles/Cards.css';


 const Cards = (props) => {
     return(
      <Card className="card">

          <CardMedia
            className="card-media"
            component="img"
            alt="Contemplative Reptile"
            height="480"
            width="300"
            image="https://placeimg.com/640/480/people"
          />

        <div className="card-content"></div>
        {/* <CardContent className="card-content"></CardContent> */}
          <Typography className="title-typo-name" >
            <b>{props.name}</b>
          </Typography>
          <Typography className="title-typo-desc" >
            {props.desc}
          </Typography>
          <Typography className="title-typo-project" variant="body2" color="textSecondary" component="p">
            <b>14 Project &nbsp;</b>
            <b>86% Rating Rate Project &nbsp;</b>
          </Typography> 
          &nbsp;
           <Typography className="title-typo-skill" variant="body2" color="textSecondary" component="p">
            <b>Skills: </b> <br/>{props.skill}
          </Typography> 
        {/* </CardContent> */}
      </Card>
     )
 } 

export default Cards
